CREATE TABLE `statistics_summery` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `project_code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '项目代码',
  `data_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '数据类型：区内明细/跨区明细/手工明细',
  `street_town` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '街道/乡镇',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '姓名',
  `id_type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '身份证' COMMENT '证件类型',
  `id_number` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '证件号码',
  `medical_category` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '医保分类',
  `total_cost` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '费用总额',
  `eligible_reimbursement` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '符合医保报销金额',
  `basic_medical_reimbursement` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '基本医疗保险报销金额',
  `serious_illness_reimbursement` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '大病报销金额',
  `large_amount_reimbursement` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '大额报销金额',
  `medical_assistance` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '医疗救助',
  `tilt_assistance` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '倾斜救助',
  `person_number` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '个人编号',
  `payment_category` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '代缴类别',
  `payment_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '代缴金额',
  `payment_date` date DEFAULT NULL COMMENT '代缴日期',
  `level` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '档次',
  `personal_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '个人支付',
  `medical_assistance_category` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '医疗救助类别',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '备注',
  `import_batch` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '导入批次',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `statistics_summary_project_code_index` (`project_code`) USING BTREE,
  KEY `statistics_summary_data_type_index` (`data_type`) USING BTREE,
  KEY `statistics_summary_id_number_index` (`id_number`) USING BTREE,
  KEY `statistics_summary_payment_category_index` (`payment_category`) USING BTREE,
  KEY `statistics_summary_medical_assistance_category_index` (`medical_assistance_category`) USING BTREE,
  KEY `statistics_summary_import_batch_index` (`import_batch`) USING BTREE,
  KEY `idx_medical_category` (`medical_category`) USING BTREE,
  KEY `idx_total_cost` (`total_cost`) USING BTREE,
  KEY `idx_eligible_reimbursement` (`eligible_reimbursement`) USING BTREE,
  KEY `idx_basic_medical_reimbursement` (`basic_medical_reimbursement`) USING BTREE,
  KEY `idx_serious_illness_reimbursement` (`serious_illness_reimbursement`) USING BTREE,
  KEY `idx_large_amount_reimbursement` (`large_amount_reimbursement`) USING BTREE,
  KEY `idx_medical_assistance` (`medical_assistance`) USING BTREE,
  KEY `idx_tilt_assistance` (`tilt_assistance`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- ----------------------------
-- Records of statistics_summery
-- ----------------------------
BEGIN;
COMMIT;

